/* Database Systems, Coronel/Morris */
/* Type of SQL : Oracle  */

CREATE TABLE lgbrand (
  brand_id   NUMBER(4,0)   NULL,
  brand_name VARCHAR2(100) NULL,
  brand_type VARCHAR2(20)  NULL
);

CREATE TABLE lgproduct (
  prod_sku      VARCHAR2(15)  NOT NULL,
  prod_descript VARCHAR2(255) NULL,
  prod_type     VARCHAR2(255) NULL,
  prod_base     VARCHAR2(255) NULL,
  prod_category VARCHAR2(255) NULL,
  prod_price    NUMBER(10,2)  NULL,
  prod_qoh      NUMBER(10,0)  NULL,
  prod_min      NUMBER(10,0)  NULL,
  brand_id      NUMBER(4,0)   NULL
);

CREATE TABLE lgvendor (
  vend_id     NUMBER(6,0)   NOT NULL,
  vend_name   VARCHAR2(255) NULL,
  vend_street VARCHAR2(50)  NULL,
  vend_city   VARCHAR2(50)  NULL,
  vend_state  VARCHAR2(2)   NULL,
  vend_zip    VARCHAR2(5)   NULL
);

CREATE TABLE lgsupplies (
  prod_sku VARCHAR2(15) NOT NULL,
  vend_id  NUMBER(5,0)  NOT NULL
);

CREATE TABLE lgdepartment (
  dept_num      NUMBER(5,0)  NOT NULL,
  dept_name     VARCHAR2(50) NOT NULL,
  dept_mail_box VARCHAR2(3)  NULL,
  dept_phone    VARCHAR2(9)  NULL,
  emp_num       NUMBER(6,0)  NULL
);

CREATE TABLE lgemployee (
  emp_num      NUMBER(6,0)  NOT NULL,
  emp_fname    VARCHAR2(20) NULL,
  emp_lname    VARCHAR2(25) NOT NULL,
  emp_email    VARCHAR2(25) NOT NULL,
  emp_phone    VARCHAR2(20) NULL,
  emp_hiredate DATE         NOT NULL,
  emp_title    VARCHAR2(45) NOT NULL,
  emp_comm     NUMBER(2,2)  NULL,
  dept_num     NUMBER(5,0)  NULL
);

CREATE TABLE lgsalary_history (
  emp_num    NUMBER(6,0)  NULL,
  sal_from   DATE         NULL,
  sal_end    DATE         NULL,
  sal_amount NUMBER(10,2) NULL
);

CREATE TABLE lgcustomer (
  cust_code    NUMBER(38,0) NOT NULL,
  cust_fname   VARCHAR2(20) NOT NULL,
  cust_lname   VARCHAR2(20) NOT NULL,
  cust_street  VARCHAR2(70) NULL,
  cust_city    VARCHAR2(50) NULL,
  cust_state   CHAR(2)      NULL,
  cust_zip     CHAR(5)      NULL,
  cust_balance NUMBER(8,2)  NULL
);

CREATE TABLE lginvoice (
  inv_num     NUMBER(38,0) NOT NULL,
  inv_date    DATE         NULL,
  cust_code   NUMBER       NULL,
  inv_total   NUMBER(11,2) NULL,
  employee_id NUMBER       NULL
);

CREATE TABLE lgline (
  inv_num    NUMBER       NOT NULL,
  line_num   NUMBER       NOT NULL,
  prod_sku   VARCHAR2(15) NULL,
  line_qty   NUMBER       NULL,
  line_price NUMBER(8,2)  NULL
);

